tle="Blog",Q.keywords="blog",Q.description="DuanFei's Blog",Q.permalink="/blog",Q.date="2015-05-18 00:00:00",Q.updated="2020-04-18 00:00:00",Q.injectAllPosts=!0,Q.markdownHeadings=[],Q.assets={},Q.attributes=Q,Q.posts=[u,O,Y,W,X,eA,tA,iA,pA,lA,oA,nA],Q.pagination={hasPrev:!0,hasNext:p,total:2,current:1,prevLink:"/blog/page/2",nextLink:e},u.type=a,u.internal=e,u.contentType=g,u.slug="use-yourself-as-a-method",u.content=e,u.createdAt=new Date(1599696e6),u.updatedAt=new Date(1602297596289),u.layout=a,u.title="《把自己作为方法》读书笔记",u.keywords=h,u.description=i,u.date=x,u.updated=h,u.assets={cover:m,feature:H},u.categories=[s],u.feature=p,u.markdownHeadings=[{text:"北京访谈　2018.3",slug:"北京访谈-2018-3",level:3},{text:j,slug:j,level:4},{text:f,slug:f,level:4},{text:I,slug:I,level:4},{text:R,slug:R,level:4},{text:D,slug:D,level:4},{text:U,slug:U,level:4},{text:b,slug:b,level:4},{text:C,slug:C,level:4},{text:"牛津访谈　2018.8",slug:"牛津访谈-2018-8",level:3},{text:E,slug:E,level:4},{text:k,slug:k,level:4},{text:y,slug:y,level:4},{text:S,slug:S,level:4},{text:G,slug:G,level:4},{text:F,slug:F,level:4},{text:v,slug:v,level:4},{text:q,slug:q,level:4},{text:P,slug:P,level:4},{text:"新研究",slug:"新研究",level:4},{text:M,slug:M,level:4},{text:"温州访谈　2018.12",slug:"温州访谈-2018-12",level:3},{text:E,slug:"访谈之前-2",level:4},{text:T,slug:T,level:4},{text:V,slug:V,level:4},{text:J,slug:J,level:4}],u.excerpt='<p>这本书最早是在整理 <a href="https://www.jiemian.com/lists/452.html">界面文化</a> 的 <a href="https://www.douban.com/doulist/128578344/">书单</a> 的时候发现的，前段时间因为听 <a href="https://www.stovol.club/">随机波动</a> 的播客节目，发掘出了不少人类学的奇怪知识。后来连续看了一段时间的访谈，许知远、梁文道、陈丹青 ...</p>\n',u.permalink="/blog/2020/09/use-yourself-as-a-method",u.attributes=u,u.categoriesInfo=[{name:s,permalink:L}],O.type=a,O.internal=e,O.contentType=g,O.slug="private-secondary-school",O.content=e,O.createdAt=new Date(1599696e6),O.updatedAt=new Date(1602297596289),O.layout=a,O.title=d,O.keywords=h,O.description=i,O.date=x,O.updated=h,O.assets={cover:m,feature:H},O.categories=[s],O.feature=p,O.markdownHeadings=[{text:d,slug:d,level:3}],O.excerpt="<p><strong>保持思想的开放性是面对复杂与高速变化的时代的唯一方案。但更重要的是，我们希望保持一种非功利的兴趣：对世界的丰富性、复杂性本身充满兴趣，真诚地渴望理解他人的经验。</strong></p>\n",O.permalink="/blog/2020/09/private-secondary-school",O.attributes=O,O.categoriesInfo=[{name:s,permalink:L}],Y.type=a,Y.internal=e,Y.contentType=g,Y.slug="restart",Y.content=e,Y.createdAt=new Date(15994368e5),Y.updatedAt=new Date(1602297596289),Y.layout=a,Y.title="重启：未完成",Y.keywords=h,Y.description=i,Y.date="2020-09-07",Y.updated=h,Y.assets={cover:t(66),feature:H},Y.categories=[w],Y.feature=!0,Y.markdownHeadings=[{text:"重启",slug:"重启",level:3},{text:"未完成",slug:"未完成",level:3}],Y.excerpt="<p>最近偏好看访谈，找来许知远的《十三邀》跟陈丹青的《局部》来看，配合着项飚的《把自己作为方法》。访谈作为一种谈话形式，我尤为关注许知远在其中的提问，如何开启话题、如何切入，提问的问题反应出了许知远如何认知“人”这个概念，从那些方面来提问也反映着背后的评价标准。比如他对李诞的一期中从李诞的成长经历开始，了解这些成长经历对如今的影响，以当今的视角对当时人事的认知等等，能够感受到许知远在挖掘人的丰富性，我们有何不同，而我们又因何不同。</p>\n",Y.permalink="/blog/2020/09/restart",Y.attributes=Y,Y.categoriesInfo=[{name:w,permalink:K}],W.type=a,W.internal=e,W.contentType=g,W.slug="good-and-bad",W.content=e,W.createdAt=new Date(157668048e4),W.updatedAt=new Date(1602297596289),W.layout=a,W.title="好与不好",W.keywords=h,W.description=i,W.date="2019-12-18 22:48",W.updated=h,W.assets={cover:t(64),feature:t(65)},W.categories=[w],W.feature=p,W.markdownHeadings=[],W.excerpt="<p>随着阅读的深入，”选择读什么“的疑惑就越来越明显。对文字、故事、观点、手法等本质没有标准的认知跟理解，好坏的判断全凭感受。</p>\n",W.permalink="/blog/2019/12/good-and-bad",W.attributes=W,W.categoriesInfo=[{name:w,permalink:K}],X.type=a,X.internal=e,X.contentType=g,X.slug="customer-journey-maps",X.content=e,X.createdAt=new Date(157512528e4),X.updatedAt=new Date(1602297596289),X.layout=a,X.title="用户体验地图",X.keywords=h,X.description=i,X.date="2019-11-30 22:48",X.updated=h,X.assets={cover:t(62),feature:t(63)},X.categories=[l],X.feature=p,X.markdownHeadings=[{text:N,slug:N,level:3},{text:z,slug:z,level:3},{text:"设计过程中什么时候需要CJM？",slug:"设计过程中什么时候需要cjm？",level:3},{text:Z,slug:Z,level:3},{text:$,slug:$,level:3},{text:_,slug:_,level:3},{text:AA,slug:AA,level:3},{text:"区域A：用户、场景、目标",slug:"区域a：用户、场景、目标",level:4},{text:"区域B：阶段",slug:"区域b：阶段",level:4},{text:"区域C：任务、思维、情感",slug:"区域c：任务、思维、情感",level:4},{text:"区域D：时机",slug:"区域d：时机",level:4},{text:"过程概述",slug:"过程概述",level:3},{text:"A final word（尾声）",slug:"a-final-word（尾声）",level:3}],X.excerpt='<p>原文地址：<a href="https://www.invisionapp.com/inside-design/customer-journey-maps/">A beginner’s guide to customer journey maps</a></p>\n',X.permalink="/blog/2019/11/customer-journey-maps",X.attributes=X,X.categoriesInfo=[{name:l,permalink:c}],eA.type=a,eA.internal=e,eA.contentType=g,eA.slug="mountains-may-depart",eA.content=e,eA.createdAt=new Date(156890448e4),eA.updatedAt=new Date(1602297596289),eA.layout=a,eA.title="山河故人",eA.keywords=h,eA.description=i,eA.date="2019-09-19 22:48",eA.updated=h,eA.assets={cover:t(61),feature:o},eA.categories=[l],eA.feature=!0,eA.markdownHeadings=[],eA.excerpt="<p>也许先看汪曾祺再回去读沈从文更能明白《边城》所表达出来的情感，之前先读过《边城》并没有读出来什么惊奇的地方，知识觉得平常，平常事、平常心、平常人。后来看过汪曾祺的《人间草木》，我对花草生物学一无所知，看的很是艰难，看了三分之一就放弃了。直到《山河故人》让我从一个学生的视角，看到了不一样的沈从文。<br>\n故事脱离了背景会变得平平常常，会丧失情绪。就像汪曾祺所言，对当时身边人事与西南大地的热爱与热情，造就了边城、沈从文、汪曾祺等等这些人。<br>\n在山河故人中汪曾祺写道：西南联大的学习生涯里面中，学习古文观止、诗经楚辞、书法，祖父曾教过他写八股文。西南联大在短短时间内教育出了很多享誉世界各领域的人物，谈及原因时，总结道：“因为自由”。</p>\n",eA.permalink="/blog/2019/09/mountains-may-depart",eA.attributes=eA,eA.categoriesInfo=[{name:l,permalink:c}],tA.type=a,tA.internal=e,tA.contentType=g,tA.slug="social-animal",tA.content=e,tA.createdAt=new Date(156164688e4),tA.updatedAt=new Date(1602297596289),tA.layout=a,tA.title="《社会性动物》：从众效应与基础认知",tA.keywords=h,tA.description=i,tA.date=r,tA.updated=h,tA.assets={cover:t(56),feature:o},tA.categories=[n],tA.feature=p,tA.markdownHeadings=[{text:aA,slug:aA,level:3},{text:hA,slug:hA,level:3},{text:"一点想法",slug:"一点想法",level:3},{text:gA,slug:gA,level:3}],tA.excerpt="<p>人类经常会有一种倾向，去从事或相信其他多数人从事或相信的东西，就是所谓的“从众效应”。产生从众效应的原因有：\n1、获得集体认可；\n2、获取恰当行为的有关信息（面对未知、我们通常通过观察他人行动而做出决策）；</p>\n",tA.permalink="/blog/2019/06/social-animal",tA.attributes=tA,tA.categoriesInfo=[{name:n,permalink:B}],iA.type=a,iA.internal=e,iA.contentType=g,iA.slug="How-to-Think-Straight-chinaese",iA.content=e,iA.createdAt=new Date(156164688e4),iA.updatedAt=new Date(1602297596289),iA.layout=a,iA.title="How to Think Straight",iA.keywords=h,iA.description=i,iA.date=r,iA.updated=h,iA.assets={cover:t(57),feature:o},iA.categories=[n],iA.feature=p,iA.markdownHeadings=[],iA.excerpt="<p>这个世界上，有两门学科是真正迷人的。一是物理学，它让我们了解我们所处的这个世界。二是心理学，它让我们了解自己。</p>\n",iA.permalink="/blog/2019/06/How-to-Think-Straight-chinaese",iA.attributes=iA,iA.categoriesInfo=[{name:n,permalink:B}],pA.type=a,pA.internal=e,pA.contentType=g,pA.slug="lorem-ipsum",pA.content=e,pA.createdAt=new Date(156164688e4),pA.updatedAt=new Date(1602297596289),pA.layout=a,pA.title="Lorem ipsum",pA.keywords=h,pA.description=i,pA.date=r,pA.updated=h,pA.assets={cover:t(58),feature:o},pA.categories=[l],pA.feature=p,pA.markdownHeadings=[{text:"起源",slug:"起源",level:3}],pA.excerpt="<p>在使用Axure的 “文本段落” 元件时，里面会默认填充一段文字</p>\n",pA.permalink="/blog/2019/06/lorem-ipsum",pA.attributes=pA,pA.categoriesInfo=[{name:l,permalink:c}],lA.type=a,lA.internal=e,lA.contentType=g,lA.slug="soul-series",lA.content=e,lA.createdAt=new Date(156164688e4),lA.updatedAt=new Date(1602297596289),lA.layout=a,lA.title="从《魂》系列游戏设定所衍生的一点想法",lA.keywords=h,lA.description=i,lA.date=r,lA.updated=h,lA.assets={cover:t(59),feature:t(60)},lA.categories=[l],lA.feature=!0,lA.markdownHeadings=[{text:"生来即为弱者",slug:"生来即为弱者",level:3},{text:"成长总有方式",slug:"成长总有方式",level:3},{text:"强者有所坚持",slug:"强者有所坚持",level:3},{text:"游戏也是人生",slug:"游戏也是人生",level:3}],lA.excerpt="<p>在过去近 10 年的时间里，知名游戏开发商 From Software 开发出了魂系列游戏，从《恶魔之魂》、《黑暗之魂》、《血源诅咒》再到如今的《只狼：影逝二度》，我们在其中被各种小怪教做人、被新手村BOSS教做人。我更是曾被古达卡了半年之久。</p>\n",lA.permalink="/blog/2019/06/soul-series",lA.attributes=lA,lA.categoriesInfo=[{name:l,permalink:c}],oA.type=a,oA.internal=e,oA.contentType=g,oA.slug="we",oA.content=e,oA.createdAt=new Date(154773648e4),oA.updatedAt=new Date(1602297596289),oA.layout=a,oA.title="我们",oA.keywords=h,oA.descripti